import React, {Component} from "react";
import { Card, Table, CardBody, Row, Col } from "reactstrap";

import icons from "../../variables/icons";

class Product extends Component {
  constructor(props) {
    super(props);
    this.state = {
      dokar: null,
      bagus: 1,
    }
  }

  render() {
    return (
      <div className="content">
        <Row>
          <Col md={12}>
            <Card>
              <CardBody>
                <Table responsive>

                </Table>
              </CardBody>
            </Card>
          </Col>
        </Row>
      </div>
    );
  }
}

export default Product;
